import { createIcon } from "../icon/createIcon";

export const SearchIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="SearchIcon">
    <path d="M4.767 0a4.767 4.767 0 0 1 3.865 7.558l3.369 3.379L10.935 12 7.568 8.624a4.767 4.767 0 1 1-2.8-8.625zm0 1.505a3.261 3.261 0 1 0 0 6.522 3.261 3.261 0 0 0 0-6.522z" />
  </svg>,
  "Search",
  "search"
);
